package main

import (
	"bytes"
	"fmt"
	"github.com/ajstarks/svgo"
	"math"
	"slices"
	"sort"
	"strconv"
)

func DrawIcon(batteryStats map[string]BatteryStat) string {
	width := 400
	height := 400

	var svgBytes bytes.Buffer
	canvas := svg.New(&svgBytes)
	canvas.Start(width, height)

	i := 0
	textStyle := "font-family: sans-serif; font-size: 72px; font-weight: bold; text-anchor: end; dominant-baseline: baseline; fill: white;"
	chargingTextStyle := textStyle + " fill: #e8e861;"
	keys := make([]string, 0, len(batteryStats))
	for k := range batteryStats {
		keys = append(keys, k)
	}
	sort.Strings(keys)
	for _, k := range keys {
		v := batteryStats[k]

		if i >= 3 {
			break
		}

		iconX := 20
		valX := 285
		iconY := 20 + (120 * i)
		valY := iconY + 80
		chargingX := 290

		if isMouse(k) {
			drawMouse(canvas, iconX, iconY)
		} else if isKeyboard(k) {
			drawKeyboard(canvas, iconX, iconY)
		} else if isHeadset(k) {
			drawHeadset(canvas, iconX, iconY)
		}

		if v.IsCharging {
			canvas.Text(valX, valY, strconv.Itoa(int(math.Round(v.Percentage))), chargingTextStyle)
			drawCharging(canvas, chargingX, iconY)
		} else {
			canvas.Text(valX, valY, strconv.Itoa(int(math.Round(v.Percentage))), textStyle)
		}

		i++
	}
	canvas.End()

	return encodeSvg(svgBytes.String())
}

func encodeSvg(svg string) string {
	return fmt.Sprintf("data:image/svg+xml;charset=utf8,%s", svg)
}

func isMouse(label string) bool {
	mouseLabels := []string{"g502wireless"}

	return slices.Contains(mouseLabels, label)
}

func isKeyboard(label string) bool {
	keyboardLabels := []string{"g915tkl"}

	return slices.Contains(keyboardLabels, label)
}

func isHeadset(label string) bool {
	headsetLabels := []string{"proxwirelessheadset"}

	return slices.Contains(headsetLabels, label)
}

